import React from 'react';
import NavButton from './NavButton/NavButton';
import './NavBar.css';

import { Link } from 'react-scroll';

function NavBar(props) {


    return (
        <div className='nav-bar'>
            <NavButton name="Education" id='educationContainer' handlePageChange={props.handlePageChange}/>
            <NavButton name="Projects" id='projectsContainer' handlePageChange={props.handlePageChange}/>
            <NavButton name="Contact" id='contactContainer' handlePageChange={props.handlePageChange}/>

            <Link to="section1" spy={true} smooth={true} offset={50} duration={500}>
                Education
            </Link>
            <Link to="section2" spy={true} smooth={true} offset={50} duration={500}>
                Projects
            </Link>
            <Link to="section3" spy={true} smooth={true} offset={50} duration={500}>
                Contact
            </Link>


        </div>
    )

    }

export default NavBar;
